import React from 'react'
import { Link } from 'react-router-dom';

const Render = () => {
    return (
        <div className='bg-white relative w-full h-auto'>
            <div className='bg-white fixed w-full inline-flex justify-end p-3'>
            <Link to="/create" className='cursor-pointer bg-indigo-800 text-white font-semibold text-center rounded px-3 py-2'>Create</Link>
            </div>
        </div>
    )
}

export default Render
